eout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"770062","type":"CustomJS"},{"attributes":{"source":{"id":"769744"}},"id":"769941","type":"CDSView"},{"attributes":{"axis":{"id":"769759"},"coordinates":null,"group":null,"ticker":null},"id":"769762","type":"Grid"},{"attributes":{},"id":"770063","type":"CrosshairTool"},{"attributes":{"overlay":{"id":"769971"}},"id":"769966","type":"BoxZoomTool"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"mode":"vline","point_policy":"follow_mouse","renderers":[{"id":"770015"}],"tooltips":[["Date","@datetime{%c}"],["x, y","$index\u00a0\u00a0\u00a0\u00a0$y{0,0.0[0000]}"],["OHLC","@Open{0,0.0[0000]}\u00a0\u00a0\u00a0\u00a0@High{0,0.0[0000]}\u00a0\u00a0\u00a0\u00a0@Low{0,0.0[0000]}\u00a0\u00a0\u00a0\u00a0@Close{0,0.0[0000]}"],["Volume","@Volume{0,0}"],["sma(C)","@{sma(C)_0_1}{0,0.0[0000]}"]]},"id":"770060","type":"HoverTool"},{"attributes":{"source":{"id":"769743"}},"id":"770044","type":"CDSView"},{"attributes":{"data":{"Close":{"__ndarray__":"KVyPwvWIVEAzMzMzM3NUQKRwPQrXc1RAmpmZmZkpVEDXo3A9CjdUQEjhehSup1RAFK5H4XoEVUDsUbgehetUQArXo3A96lRAexSuR+HqVEBSuB6F6xFVQOF6FK5HMVVAAAAAAAAwVUApXI/C9XhVQFK4HoXrsVVAhetRuB6lVUC4HoXrUahVQB+F61G4jlVAw/UoXI9SVUCuR+F6FG5VQDMzMz
